import React from "react";
import { BrowserRouter, Route as Router } from "react-router-dom";
import About from "../pages/About";
import Home from "../pages/Home";

export default () => (
  <Router>
    <Navigation>
      <Route exact path="/">
        <Home />
      </Route>
      <Route exact path="/about">
        <About />
      </Route>
    </Navigation>
  </Router>
);
